INSERT INTO "email_collector_continent" VALUES(1,'Asia','asia','Asia, being the earth''s largest continent, has plenty of great snowfields to suit all tastes, ranging from some of the best powder in Japan, to some of the highest mountains in the Himalayas.',1,'2016-04-03 05:46:47.336323','2016-04-03 05:46:47.336412');
INSERT INTO "email_collector_continent" VALUES(2,'Africa','africa','Africa rarely rates a mention in the world of skiing, however it does have a handful of ski resorts.   The main areas are Algeria and Morocco, although there are other small resorts in other parts of the continent that offer the enjoyment of skiing in Africa.',0,'2016-04-03 05:50:23.297730','2016-04-03 05:52:44.454550');
INSERT INTO "email_collector_continent" VALUES(3,'Antarctica','antarctica','Antarctica naturally offers potential for some of the most memorable skiing on earth, both alpine and cross country.  The two main regions in Antarctica are the inland ice cap, and the peninsula.  Inland, of course, offers extensive cross country skiing.  On the peninsula there are opportunities to ski next to massive glaciated mountains that drop steeply into the sea.',1,'2016-04-03 05:59:22.418758','2016-04-03 05:59:22.418817');
INSERT INTO "email_collector_continent" VALUES(4,'Australia & Oceania','oceania','The two skiing regions in Oceania are Australia and New Zealand.   In New Zealand, the south island in particular offers world-class skiing,  with spectacular mountain terrain, long vertical descents and substantial snow levels.  Australia''s ski regions are typically larger but flatter terrains, and offer skiing through the snow gums.',0,'2016-04-03 06:20:29.422646','2016-04-03 06:20:29.422704');
INSERT INTO "email_collector_continent" VALUES(5,'Europe','europe','',1,'2016-04-03 06:20:53.762053','2016-04-03 06:20:53.762168');
INSERT INTO "email_collector_continent" VALUES(6,'North America','north-america','',0,'2016-04-03 06:21:04.860712','2016-04-03 06:21:04.860794');
INSERT INTO "email_collector_continent" VALUES(7,'South America','south-america','',0,'2016-04-03 06:21:14.915023','2016-04-03 06:21:14.915080');
INSERT INTO "email_collector_location" VALUES(1,'perisher','Perisher is located in the NSW area of the Snowy Mountains.   The resort was known as Perisher Blue until 2009 upon the almagamation of four villages, Perisher Valley, Smiggin Holes, Guthega, and Blue Cow.  Their associated ski fields covering approximately 12 square kilometres (5 sq mi), with the base elevation at 1,720 metres (5,640 ft) AHD, and the summit elevation of 2,054 metres (6,739 ft) at the top of Mount Perisher.','2016-03-28 04:40:27.810810','2016-03-28 04:40:27.810870',1,'1','Perisher');
INSERT INTO "email_collector_location" VALUES(2,'thredbo','Thredbo is a village and ski resort about 390km southwest of Sydney, in the Snowy Mountains of New South Wales, Australia.  It is about 500 kilometres south of Sydney, accessible by the Alpine Way via Cooma, Berridale, and Jindabyne. Jindabyne which is 30km away, has a population of around 4,400.
INSERT INTO "email_collector_location" VALUES(3,'charlotte-pass','Charlotte Pass is situated in the heart of the NSW Snowy Mountains, about 10km away from Australia''s highest mountain, Mount Kosciuszko (2,228m).','2016-03-28 06:15:00.984812','2016-03-28 06:15:00.984864',1,'1','Charlotte Pass');
INSERT INTO "email_collector_region" VALUES(1,'snowy-mountains','The Snowy Mountains, known informally as "The Snowies", is the highest mountain range in Australia. It contains the Australian mainland''s highest mountain, Mount Kosciuszko (2,228 m or 7,310 ft). The range also contains the five highest peaks on the Australian mainland (including Mount Kosciuszko), all of which are above 2,100 m (6,890 ft). They are located in southern New South Wales and are part of the larger Australian Alps and Great Dividing Range. Unusual for Australia, the mountain range experiences large natural snowfalls every winter. Snow normally falls the most during June, July and early August. 
INSERT INTO "email_collector_region" VALUES(2,'ben-lomond-mountain','Ben Lomond is a mountain in the north east of Tasmania, Australia, within the Ben Lomond National Park. The mountain is composed of a central massif with an extensive plateau above 1,200 metres (3,900 ft) and high outlier peaks projecting from the mountain. The highest feature on the plateau is the unimposing summit of Legges Tor, at 1572 m, on the northern aspect of the plateau. The southern end of the plateau is dominated by Stacks Bluff, 1,527 metres (5,010 ft), which is an imposing feature that drops away to a cliffline 600 metres (2,000 ft) above the surrounding foothills. The prominent outlier peaks of Ragged Jack (1,369 metres (4,491 ft)), Mensa Moor (1,358 metres (4,455 ft)) and Tower Hill (1,122 metres (3,681 ft)) surround the plateau.[2]','2016-03-28 06:27:02.529819','2016-03-28 06:38:18.352453',14,'Ben Lomond');
INSERT INTO "email_collector_region" VALUES(3,'mount-mawson-region','Mount Mawson is situated within the Mount Field National Park in Tasmania Australia. The mountain is located 89 kilometres north west of Hobart and 232 kilometres from Launceston by road. Mount Mawson''s summit rises to 1,320 metres above sea level slightly lower than the 1,460 meters Ben Lomond ski-field in northern Tasmania.','2016-03-28 06:37:55.981566','2016-03-28 06:37:55.981626',14,'Mount Mawson');
INSERT INTO "email_collector_resort" VALUES(1,'Perisher','perisher','Perisher is Australia''s largest ski resort, and also the largest in the Southern Hemisphere. The resort has some 250 snow guns 4.4 square kilometers (1.7 sq mi) of this area to artificially supplement the natural snowfall. Perisher was acquired by Vail Resorts, USA on March 30, 2015 for a sum of approximately AU$177 million.',148.3864,-36.4093,'2016-03-28 04:44:02.619015','2016-04-03 02:21:56.612515',1,'australia/perisher.jpg',1720,2,2034,47,1605,'2016-10-03','2016-06-11',2054,5,'australia/perisher_560x396.jpg');
INSERT INTO "email_collector_resort" VALUES(2,'Thredbo Alpine Village','thredbo','Thredbo is about 1450m above sea level, and during peak snow conditions, Thredbo has the longest ski runs in Australia. In summer, Thredbo is a hiking and summer sport destination, including rock climbing and abseiling, fishing and cross-country cycling, and hosts a blues music festival.  The town contains 4,000 tourist beds, but has a permanent population of only about 500 people.',148.31117,-36.49958,'2016-03-28 05:58:56.716954','2016-03-30 08:05:30.678433',2,'australia/thredbo.jpg',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'australia/thredbo_560x396.jpg');
INSERT INTO "email_collector_resort" VALUES(3,'Charlotte Pass','charlotte-pass','At 1765 metres, Charlotte Pass is Australia''s highest resort, and consequently receives some of the most consistent snowfalls delivering the best quality natural snow. The resort offers ski-in ski-out accommodation and facilities. Completely snowbound at the top of Australia, Charlotte Pass is only accessible by Oversnow Transport.  Whether you’re a beginner testing out your snow legs on Easy Starter, an intermediate carving up Kosi Coaster, an experienced skier looking for adventure on Sidewinder or a hardcore rider after an adrenalin rush at Guthrie’s Chutes.',148.3388,-36.431,'2016-03-28 06:15:10.388262','2016-03-30 03:19:11.804254',3,'australia/charlotte-pass.jpg',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'australia/charlotte-pass_560x396.jpg');
