INSERT INTO "email_collector_country" VALUES(14,'Australia','australia','Australia''s ski regions lie on the Great Dividing Range, the main mountain range running along the east coast of Australia.  The terrain is relatively flat, lending itself more to cross country & ski touring.  Nonetheless there are a number of quite popular downhill ski resorts, mostly in the region known as the Snowy Mountains.  These are in the three states of New South Wales, Victoria and Tasmania. 
